Flushing Meadows Corona Park has always been a place for immigrants and community to gather. It’s one of my earliest memories of childhood and today I’m so excited to announce on Sunday July 23, 2023 a FREE concert with a dream line-up of artists. We’re bringing that @basementbhangra energy to my home and the World’s borough of Queens with Malkit Singh – the King of Bhangra – with a live band, DJ Ana, Chutney Soca DJ mainstay and "Island Girl" of East Indian descent; Rolex Rasathy, a professionally trained Carnatic musician heavily influenced by jazz, R&B, and hip-hop; Param Singh, Punjabi singer who broke out with his 2016 hit “Daru Badnaam” with Kamal Kahlon, which has more than a billion views on YouTube; the self-taught dholki musician Dholi Anuradha; and The Shadow Notes, who draw haunting hooks and arcane beats from their homelands of Trinidad and Punjab.

Thank you to @summerstage and @CPFNY for making this event possible. As always, it's a FREE event. Save the Date to your calendar.

